const TableBody = ({data, columns}) => {
  return (
    <>
      <tbody>
        {columns.map((row) => {
          return (
            <>
              <tr>
                  {
                      columns.map(col => {
                          return (
                              col.content(row)
                          )
                      })
                  }
                <td>{row.id}</td>
                <td>{row.first_name}</td>
                <td>{row.last_name}</td>
                <td>{row.handle}</td>
              </tr>
            </>
          );
        })}
      </tbody>
    </>
  );
};

export default TableBody;
